import axios from 'axios';
import * as CONSTANTS from '../constants';

export const fechProducts = async () => {
  try {
    const { data } = await axios.get(
      `${CONSTANTS.BaseApi}v${CONSTANTS.products.getAll}`,
    );
    return data;
  } catch (error) {
    return error;
  }
};
